import { useState } from "react"
import React from "react"

export default function Cart({cart}) {
    const [korzinaState, setKorzinaState] = useState(false)
    function deleteState() {
        setKorzinaState(true)
    }
    
    return(
        <div className={korzinaState===false? 'sale_container' : ''}>
            {cart.map((e)=> {
                return(<>
                    <div className="box" key={e.id}>
                        <div className="img-box">
                            <img src={e.img} alt=""/>
                        </div>
                        <div className="detail-box">
                            <h6>{e.name}</h6>
                            <button className="plus" onClick={deleteState}>-</button>
                            <p>{e.opisanie}</p>
                        </div>
                    </div>
                </>)
            })}
         
        </div>
    )
}
